import React from 'react';
import './App.css';
import LoginIcon from "./imgs/login-icon.png"

function App() {
  return (
    <div className="app">
      <div className="form">
        <div className="wallpaper">
          <img src={LoginIcon} alt="login-icon"></img>
        </div>
        <div className="welcome-message">
          Welcome to our website <br /> Login or Signup
        </div>
        <div>
          hello
        </div>
      </div>
    </div>
  );
}

export default App;
